import logo from './logo.svg';
import './App.css';
import React from 'react';
import {WorkTable, EducationTable}  from './components/table';

class App extends React.Component {

  constructor(props) {
    // initializing
    super(props);
    this.details = require('./details/resume.json');
  }

  componentDidMount() {
    // Setting title of page
    document.title = "Resume";
    document.body.style.backgroundColor = "gray";
  }



  render() {
    return (
      <div className="App">
        <WorkTable      details={this.details.WorkExperience} tableName="Experience" />
        <WorkTable      details={this.details.Internship}     tableName="Internship" />
        <EducationTable details={this.details.Education}      tableName="Education" />
    </div>
    );
  }
}

export default App;
